import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getDrivers } from "../../store/actions/driverActions";
import DriverItem from "./DriverItem";
import PropTypes from "prop-types";
import Preloader from "../layout/Preloader";
import logo from "../../img/Logo.png";

const Drivers = ({ getDrivers, driver: { drivers, loading } }) => {
  useEffect(() => {
    getDrivers();

    // eslint-disable-next-line
  }, []);

  if (loading || drivers === null) {
    return <Preloader />;
  }

  return (
    <div>
      <nav>
        <div className="nav-wrapper">
          <a href={logo} className="brand-logo center">
            Logo
          </a>
          <ul className="right">
            <li>
              <img src="#!" alt="" />
            </li>
            <li>
              <ul className="collection green accent-4">
                <li className="collection-item">Profile</li>
                <li className="collection-item">Settings</li>
                <li className="collection-item">My Routes</li>
                <li className="collection-item">Logout</li>
              </ul>
            </li>
          </ul>
        </div>
      </nav>

      <div className="row">
        <div className="col s8">
          <ul className="collection with-header">
            <li className="collection-header">
              <h4 className="center">Roy's Routes</h4>
            </li>

            {drivers.map(driver => (
              <DriverItem driver={driver} key={driver.id} />
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

Drivers.propTypes = {
  driver: PropTypes.object.isRequired,
  getDrivers: PropTypes.func.isRequired
};

const mapStateToProps = state => ({
  driver: state.driver
});

export default connect(mapStateToProps, { getDrivers })(Drivers);
